INSERT INTO `field_data_body` VALUES ('node','page',0,8,8,'und',0,'<div class=\"contentset center\">\r\n	<div class=\"inner\"><span>New Customer</span></div>\r\n</div>\r\n	\r\n<div class=\"control-group\">\r\n\r\n	<span class=\"featured-image\"><img style=\"float: left; margin-right: 15px;\" src=\"/newbreed/sites/default/files/pages/New-Breed-Wireless-Gift-Bag_75_0.png\" width=\"126\" height=\"230\" alt=\"\"></span>\r\n	\r\n	<br><br><br>\r\n	\r\n	<h4>\r\n	<ul class=\"js-animated-list\">\r\n		<li>SPECIAL OFFERS</li>\r\n		<li>PRICE REDUCTIONS</li>\r\n		<li>MOBILE COUPONS</li>\r\n		<li>SPECIAL INVITATIONS</li>\r\n		<li>CONTROL</li>\r\n	</ul>	\r\n	</h4>\r\n	\r\n</div>\r\n			\r\n<div style=\"clear: both;\">\r\n	<br>\r\n	<p>Become an NBW VIP!  You give us your information and we give you value!  When you confidentially provide us information we can help you customize the perfect shopping experience.  From our Wireless Gift Bags, we will provide special offers for you to buy the things you want and request special offers to be delivered to your mobile phone. New Breed W puts you in control and now you are in the Drivers Seat.  3S Privacy guarantee</p>\r\n\r\n	<div class=\"align-center\">	\r\n		<a id=\"button-account\" class=\"btn btn-inverse\" href=\"user/register\"><span>Sign up</span></a>\r\n	</div>\r\n</div>','','full_html');
